import Vue from 'vue';
import Vuetify from 'vuetify';
import App from './App.vue';
import router from './router';
import store from './store';
import VuetifyConfirm from './component/dialog/confirm'
import EventBus from './event-bus';

import 'vuetify/dist/vuetify.min.css';

Vue.use(EventBus);
Vue.use(Vuetify);
Vue.config.productionTip = false;


Vue.use(VuetifyConfirm, {
  buttonTrueText: 'Yes',
  buttonFalseText: 'No',
  color: 'warning',
  icon: 'warning',
  title: 'Warning',
  width: 350,
  property: '$confirm'
});

new Vue({
  router,
  store,
  render: h => h(App),
}).$mount('#app');
